import express from "express";
import { requireAuth } from "../middleware/authMiddleware.js";
import { createOrUpdateProfile, getProfile, uploadImage } from "../controllers/companyController.js";

const router = express.Router();

router.get("/profile", requireAuth, getProfile);
router.post("/profile", requireAuth, createOrUpdateProfile);
router.put("/profile", requireAuth, createOrUpdateProfile);

// upload logo/banner
router.post("/upload", requireAuth, uploadImage);

export default router;
